task1/Voting.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8;

//  创建一个名为Voting的合约，包含以下功能：
// 一个mapping来存储候选人的得票数
// 一个vote函数，允许用户投票给某个候选人
// 一个getVotes函数，返回某个候选人的得票数
// 一个resetVotes函数，重置所有候选人的得票数

contract Voting{
    mapping (address => mapping (string => uint256)) public votes;
    function vote(address addr, string memory name, uint256 acount ) public {
        votes[addr][name] = acount;
    }
}

